			"rulings": [{
				"date": "2022-02-18",
				"text": "If you choose to discard a card as The Restoration of Eiganjos second chapter ability resolves, a second triggered ability goes on the stack and you choose a target for it. Notably, this means you may target the card you discarded if it is a permanent card with mana value 2 or less."
			}, {
				"date": "2022-02-18",
				"text": "Each face of a transforming double-faced card has its own set of characteristics: name, types, subtypes, abilities, and so on. While a transforming double-faced permanent is on the battlefield, consider only the characteristics of the face thats currently up. The other set of characteristics is ignored."
			}, {
				"date": "2022-02-18",
				"text": "Each transforming double-faced card in this set is cast face up. In every zone other than the battlefield, consider only the characteristics of its front face. If it is on the battlefield, consider only the characteristics of the face thats up; the other faces characteristics are ignored."
			}, {
				"date": "2022-02-18",
				"text": "The mana value of a transforming double-faced card is the mana value of its front face, no matter which face is up."
			}, {
				"date": "2022-02-18",
				"text": "The back face of a transforming double-faced card usually has a color indicator that defines its color."
			}, {
				"date": "2022-02-18",
				"text": "A transforming double-faced card enters the battlefield with its front face up by default, unless a spell or ability instructs you to put it onto the battlefield transformed or you cast it transformed, in which case it enters with its back face up."
			}, {
				"date": "2022-02-18",
				"text": "If you are instructed to put a card that isnt a double-faced card onto the battlefield transformed, it will not enter the battlefield at all. In that case, it stays in the zone it was previously in. For example, if a single-faced card is a copy of Azusas Many Journeys, the chapter III ability will cause it to be exiled and then remain in exile."
			}],
