			"name": "March of Swirling Mist",
			"number": "61",
			"originalText": "As an additional cost to cast this spell, you may exile any number of blue cards from your hand. This spell costs {2} less to cast for each card exiled this way.Up to X target creatures phase out. (While theyre phased out, theyre treated as though they dont exist. Each one phases in before its controller untaps during their next untap step.)",
