			"rarity": "common",
			"rulings": [{
				"date": "2022-02-18",
				"text": "The ninjutsu ability can be activated only after blockers have been declared. Before then, attacking creatures are neither blocked nor unblocked."
			}, {
				"date": "2022-02-18",
				"text": "As you activate a ninjutsu ability, you reveal the Ninja card in your hand and return the attacking creature. The Ninja card stays revealed and isnt put onto the battlefield until the ability resolves. If it leaves your hand before then, it wont enter the battlefield at all."
			}, {
				"date": "2022-02-18",
				"text": "The creature with ninjutsu enters the battlefield attacking the same player or planeswalker that the returned creature was attacking. This is a rule specific to ninjutsu; in other cases, when a creature is put onto the battlefield attacking, that creatures controller chooses which player or planeswalker its attacking."
			}, {
				"date": "2022-02-18",
				"text": "Although the Ninja is attacking, it was never declared as an attacking creature (for purposes of abilities that trigger whenever a creature attacks, for example)."
			}, {
				"date": "2022-02-18",
				"text": "The ninjutsu ability can be activated during the declare blockers step, combat damage step, or end of combat step. In most cases (see below), if you wait until the combatdamage step or end of combat step, it will be after combat damage has been dealt, so the Ninja wont deal combat damage."
			}, {
				"date": "2022-02-18",
				"text": "If a creature in combat has first strike or double strike, you can activate the ninjutsu ability during the first-strike combat damage step. The Ninja will deal combat damage during the regular combat damage step, even if it has first strike."
			}, {
				"date": "2022-02-18",
				"text": "Puff of smoke not included."
			}],
