			"rarity": "rare",
			"rulings": [{
				"date": "2022-02-18",
				"text": "You choose which opponent or opposing planeswalker the token is attacking as you put it onto the battlefield. It doesnt have to be the same player or planeswalker Thousand-Faced Shadow is attacking. (Remember that the rules for ninjutsu specify that a creature that enters the battlefield attacking because of a ninjutsu ability attacks the same player or planeswalker the returned unblocked creature was.)"
			}, {
				"date": "2022-02-18",
				"text": "Although the token is attacking, it was never declared as an attacking creature (for purposes of abilities that trigger whenever a creature attacks, for example)."
			}, {
				"date": "2022-02-18",
				"text": "The token copies exactly what was printed on the original creature and nothing else (unless that permanent is copying something else or is a token; see below). It doesnt copy whether that creature has any counters on it or Auras and/or Equipment attached to it, or any non-copy effects that changed its power, toughness, types, color, and so on. Notably, it doesnt copy any effects that may have turned a noncreature permanent into a creature. If the token isnt a creature as it enters the battlefield, it wont be attacking."
			}, {
				"date": "2022-02-18",
				"text": "If the copied creature had {X} in its mana cost, X is 0."
			}, {
				"date": "2022-02-18",
				"text": "If the copied creature was copying something else, the token enters the battlefield as whatever that creature was copying."
			}, {
				"date": "2022-02-18",
				"text": "If the copied creature is a token, the token created by Thousand-Faced Shadow copies the original characteristics of that token as stated by the effect that put it onto the battlefield."
			}, {
				"date": "2022-02-18",
				"text": "Any enters-the-battlefield abilities of the copied creature will trigger when the token enters the battlefield. Any “As [this creature] enters the battlefield” or “[This creature] enters the battlefield with” abilities of the copied creature will also work."
			}, {
				"date": "2022-02-18",
				"text": "The ninjutsu ability can be activated only after blockers have been declared. Before then, attacking creatures are neither blocked nor unblocked."
			}, {
				"date": "2022-02-18",
				"text": "As you activate a ninjutsu ability, you reveal the Ninja card in your hand and return the attacking creature. The Ninja card stays revealed and isnt put onto the battlefield until the ability resolves. If it leaves your hand before then, it wont enter the battlefield at all."
			}, {
				"date": "2022-02-18",
				"text": "The creature with ninjutsu enters the battlefield attacking the same player or planeswalker that the returned creature was attacking. This is a rule specific to ninjutsu; in other cases, when a creature is put onto the battlefield attacking, that creatures controller chooses which player or planeswalker its attacking."
			}, {
				"date": "2022-02-18",
				"text": "Although the Ninja is attacking, it was never declared as an attacking creature (for purposes of abilities that trigger whenever a creature attacks, for example)."
			}, {
				"date": "2022-02-18",
				"text": "The ninjutsu ability can be activated during the declare blockers step, combat damage step, or end of combat step. In most cases (see below), if you wait until the combatdamage step or end of combat step, it will be after combat damage has been dealt, so the Ninja wont deal combat damage."
			}, {
				"date": "2022-02-18",
				"text": "If a creature in combat has first strike or double strike, you can activate the ninjutsu ability during the first-strike combat damage step. The Ninja will deal combat damage during the regular combat damage step, even if it has first strike."
			}, {
				"date": "2022-02-18",
				"text": "Puff of smoke not included."
			}],
