			"rarity": "rare",
			"rulings": [{
				"date": "2022-02-18",
				"text": "The token created by Reflection of Kiki-Jiki copies exactly what was printed on the original creature (except that the copy also has haste) and nothing else (unless its copying a creature thats a token or thats copying something else; see below). It doesnt copy whether the creature is tapped or untapped, whether it has any counters on it or Auras and/or Equipment attached to it, or any non-copy effects that changed its power, toughness, types, color, and so on. Most notably, if the target creature isnt normally a creature, the copy wont be a creature."
			}, {
				"date": "2022-02-18",
				"text": "If the copied creature has {X} in its mana cost, X is 0."
			}, {
				"date": "2022-02-18",
				"text": "If a copied creature is copying something else, the token you create will use the copiable values of the target creature. In most cases, it will just be a copy of whatever that creature is copying."
			}, {
				"date": "2022-02-18",
				"text": "If a copied creature is a token that isnt a copy of something else, the copy copies the original characteristics of that token as stated by the effect that created it."
			}, {
				"date": "2022-02-18",
				"text": "Any enters-the-battlefield abilities of the copied creature will trigger when the token enters the battlefield. Any “as [this permanent] enters the battlefield” or “[this permanent] enters the battlefield with” abilities of the copied creature card will also work."
			}, {
				"date": "2022-02-18",
				"text": "If another creature becomes a copy of, or enters the battlefield as a copy of, the token, that creature will copy the creature card the token is copying, except it will also have haste. However, you wont sacrifice the new copy at the beginning of the next end step."
			}, {
				"date": "2022-02-18",
				"text": "If Reflection of Kiki-Jikis ability creates multiple tokens due to a replacement effect (such as the one Doubling Season creates), youll sacrifice each of them."
			}, {
				"date": "2022-02-18",
				"text": "Each face of a transforming double-faced card has its own set of characteristics: name, types, subtypes, abilities, and so on. While a transforming double-faced permanent is on the battlefield, consider only the characteristics of the face thats currently up. The other set of characteristics is ignored."
			}, {
				"date": "2022-02-18",
				"text": "Each transforming double-faced card in this set is cast face up. In every zone other than the battlefield, consider only the characteristics of its front face. If it is on the battlefield, consider only the characteristics of the face thats up; the other faces characteristics are ignored."
			}, {
				"date": "2022-02-18",
				"text": "The mana value of a transforming double-faced card is the mana value of its front face, no matter which face is up."
			}, {
				"date": "2022-02-18",
				"text": "The back face of a transforming double-faced card usually has a color indicator that defines its color."
			}, {
				"date": "2022-02-18",
				"text": "A transforming double-faced card enters the battlefield with its front face up by default, unless a spell or ability instructs you to put it onto the battlefield transformed or you cast it transformed, in which case it enters with its back face up."
			}, {
				"date": "2022-02-18",
				"text": "If you are instructed to put a card that isnt a double-faced card onto the battlefield transformed, it will not enter the battlefield at all. In that case, it stays in the zone it was previously in. For example, if a single-faced card is a copy of Azusas Many Journeys, the chapter III ability will cause it to be exiled and then remain in exile."
			}],
