				"date": "2022-02-18",
				"text": "Vessel of the All-Consumings first triggered ability will trigger whenever it deals any damage, not just combat damage. If it deals damage to multiple players and/or permanents at the same time (perhaps because of trample or because it was blocked by multiple creatures), that ability triggers only once."
