			"rulings": [{
				"date": "2022-02-18",
				"text": "If the spell thats copied is modal (that is, it says “Choose one —” or the like), the copy created by Jin-Gitaxiass first ability will have the same mode or modes. You cant choose different ones."
			}, {
				"date": "2022-02-18",
				"text": "If the spell thats copied had damage divided to targets as it was cast, the division cant be changed, although the targets receiving that damage still can. The same is true of spells that distribute counters to targets as it was cast."
			}, {
				"date": "2022-02-18",
				"text": "You cant choose to pay any additional costs for the copy created by Jin-Gitaxiass first ability. However, effects based on any additional costs that were paid for the original spell are copied as though those same costs were paid for the copy too."
			}, {
				"date": "2022-02-18",
				"text": "The copies that Jin-Gitaxiass first ability creates are created on the stack, so theyre not “cast.” Abilities that trigger when a player casts a spell wont trigger."
			}, {
				"date": "2022-02-18",
				"text": "A copy is created even if the spell that caused the ability to trigger has been countered by the time that ability resolves. The copy resolves before the original spell."
			}, {
				"date": "2022-02-18",
				"text": "Jin-Gitaxiass last ability triggers once each turn, not once each turn per opponent."
			}],
