			"originalText": "(As this Saga enters and after your draw step, add a lore counter.)I — Create a 2/2 red Goblin Shaman creature token with Whenever this creature attacks, create a Treasure token.II — You may discard up to two cards. If you do, draw that many cards.III — Exile this Saga, then return it to the battlefield transformed under your control.",
			"originalType": "Enchantment — Saga",
			"otherFaceIds": ["b384f442-c485-587e-954e-f3bc0962daa1"],
