			"rarity": "rare",
			"rulings": [{
				"date": "2022-02-18",
				"text": "Phased out permanents are treated as though they dont exist. They cant be the target of spells or abilities, their static abilities have no effect on the game, their triggered abilities cant trigger, they cant attack or block, and so on."
			}, {
				"date": "2022-02-18",
				"text": "As a creature is phased out, Auras and Equipment attached to it also phase out at the same time. Those Auras and Equipment will phase in at the same time that creature does, and theyll phase in still attached to that creature."
			}, {
				"date": "2022-02-18",
				"text": "Permanents phase back in during their controllers untap step, immediately before that player untaps their permanents. Creatures that phase in this way are able to attack and pay a cost of {T} during that turn. If a permanent had counters on it when it phased out, it will have those counters when it phases back in."
			}, {
				"date": "2022-02-18",
				"text": "An attacking or blocking creature that phases out is removed from combat."
			}, {
				"date": "2022-02-18",
				"text": "Phasing out doesnt cause permanents to leave or re-enter the battlefield, so no “leaves the battlefield” or “enters the battlefield” abilities will trigger."
			}, {
				"date": "2022-02-18",
				"text": "Any continuous effects with a “for as long as” duration, such as that of Mind Flayer, ignore phased-out objects. If ignoring those objects causes the effects conditions to no longer be met, the duration will expire."
			}, {
				"date": "2022-02-18",
				"text": "Choices made for permanents as they entered the battlefield are remembered when they phase in."
			}, {
				"date": "2022-02-18",
				"text": "If an opponent gains control of one of your creatures, that creature phases out, and the duration of the control-change effect expires before it phases back in, that creature phases in under your control as that opponents next untap step begins. If they leave the game before their next untap step, it phases in as the next untap step begins after their turn would have begun."
			}, {
				"date": "2022-02-18",
				"text": "You may exile more cards than necessary for March of Swirling Mists first ability, but you cant reduce the mana it costs to less than {U} this way."
			}, {
				"date": "2022-02-18",
				"text": "The mana value of March of Swirling Mist while its on the stack is the value chosen for X plus 1, no matter how much mana you actually paid to cast it."
			}],
